<script>
var map = document.getElementById("svgcirco");
var where = "";
function zoomIn(circo) {
  if (where!="") {
    return
  }
  where ="zoomin";
  var currentCirco = document.getElementById(circo);
    var currentDep = document.getElementById("972");

    var s = currentDep.getBBox();

    var viewDep = "" + (s.x-s.width/6) + " " + (s.y-s.height/6) + " " + (s.width*1.33) + " " + (s.height*1.33);
    var s = currentCirco.getBBox();
    var viewCirco = "" + (s.x-s.width/6) + " " + (s.y-s.height/6) + " " + (s.width*1.33) + " " + (s.height*1.33);
    tl = new TimelineMax({ onComplete:function() { where = '';}});

    tl.add("zIn");
    tl.fromTo(map, 2, {
      attr: { viewBox: "0 0 4345.875 2100.3276"}
    }, {
      attr: { viewBox: viewDep }
    }, "zIn");
    tl.to(map, 1, {
      attr: { viewBox: viewCirco }
    }, "zIn+=2.3");

}
function zoomOut(circo) {
  if (where!="") {
    return
  }
  where ="zoomout";


  var currentCirco = document.getElementById(circo);

    var s = currentCirco.getBBox();

    var oldView = "" + (s.x-s.width/6) + " " + (s.y-s.height/6) + " " + (s.width*1.33) + " " + (s.height*1.33);
    tl = new TimelineMax({ onComplete:function() { where = '';}});

    tl.add("zOut");
    tl.fromTo(map, 1.5, {
      attr: { viewBox: oldView }
    }, {
      attr: { viewBox: "0 0 4345.875 2100.3276"}
    }, "zOut");

}
$("#testbox").mouseenter(function() { zoomIn('972-02');})
             .mouseleave(function() { zoomOut('972-02');});
